import React from 'react';
import Navbar from '../navSection/Navbar';
import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/esm/Button';

function Order() {
  const data = {
    products: [
      {
        contents: [
          { name: 'jollof rice', quantity: 2, category: 'food' },
          { name: 'fried chicken', quantity: 5, category: 'meat' },
          { name: 'bottle water', quantity: 1, category: 'water' },
          { name: 'okro and panded yam', quantity: 7, category: 'food' },
        ],
        img: '/images/ghanajolof.jpg',
      },
      {
        contents: [
          { name: 'jollof rice', quantity: 2, category: 'food' },
          { name: 'fried chicken', quantity: 5, category: 'meat' },
          { name: 'bottle water', quantity: 1, category: 'water' },
          { name: 'okro and panded yam', quantity: 7, category: 'food' },
        ],
        img: '/images/freshfoods.jpg',
      },
      {
        contents: [
          { name: 'jollof rice', quantity: 2, category: 'food' },
          { name: 'fried chicken', quantity: 5, category: 'meat' },
          { name: 'bottle water', quantity: 1, category: 'water' },
          { name: 'okro and panded yam', quantity: 7, category: 'food' },
        ],
        img: '/images/jolofffff.jpg',
      },
      {
        contents: [
          { name: 'jollof rice', quantity: 2, category: 'food' },
          { name: 'fried chicken', quantity: 5, category: 'meat' },
          { name: 'bottle water', quantity: 1, category: 'water' },
          { name: 'okro and panded yam', quantity: 7, category: 'food' },
        ],
        img: '/images/okroandfufu.jpeg',
      },
    ],
    resident: {
      name: 'johnson paul',
      phone: '08037262827',
      address: '123 Main St, Suite 330, Boston MA, USA',
      km: 25,
    },
  };

  return (
    <div>
      <Navbar />
      <Container className="my-3">
        <div className="d-flex  p-3 border   justify-content-between ">
          <div className="d-flex flex-column ">
            {' '}
            <div className=" mb-2">
              {' '}
              <h3>Order ID: a2344ghd4783322bc983</h3>
            </div>
            <div className="d-flex align-items-center gap-3">
              {' '}
              <Button
                variant="success"
                className="fw-bold d-flex align-items-center"
              >
                Proccess
              </Button>
              <Button
                variant="danger"
                className="fw-bold d-flex align-items-center"
              >
                Cancel
              </Button>
            </div>
            <div>
              <strong>Name: {data.resident.name}</strong>
              <strong>phone number: {data.resident.phone}</strong>
              
            </div>
          </div>
          <div className="text-end">
            {' '}
            <Button variant="link text-success">Sales History</Button>
          </div>
        </div>
      </Container>
    </div>
  );
}

export default Order;
